import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const InstructorHome = () => {
  const navigate = useNavigate();
  const [instructor, setInstructor] = useState(null);

  useEffect(() => {
    const storedInstructor = JSON.parse(localStorage.getItem("instructor"));
    if (!storedInstructor || localStorage.getItem("isLoggedIn") !== "true") {
      navigate("/login");
    } else {
      setInstructor(storedInstructor);
    }
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem("isLoggedIn");
    navigate("/login");
  };

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <aside className="w-1/5 bg-indigo-800 text-white p-6">
        <h2 className="text-xl font-bold">Instructor Panel</h2>
        <nav className="mt-6">
          <ul className="space-y-4">
            <li className="hover:bg-indigo-700 p-2 rounded"><a href="#">Home</a></li>
            <li className="hover:bg-indigo-700 p-2 rounded"><a href="#">Courses</a></li>
            <li className="hover:bg-indigo-700 p-2 rounded"><a href="#">Grades</a></li>
            <li className="hover:bg-indigo-700 p-2 rounded"><a href="#">Reports</a></li>
          </ul>
        </nav>
        <button 
          onClick={handleLogout} 
          className="mt-6 bg-red-500 px-4 py-2 rounded w-full"
        >
          Logout
        </button>
      </aside>

      {/* Main Content */}
      <main className="flex-1 p-8">
        {/* Header */}
        <header className="flex justify-between items-center">
          <h1 className="text-2xl font-bold">Welcome, {instructor?.name || "Instructor"}!</h1>
          <div className="bg-gray-200 px-4 py-2 rounded">
            <span className="text-gray-700">{instructor?.email}</span>
          </div>
        </header>

        {/* Quick Stats */}
        <section className="mt-6 grid grid-cols-3 gap-4">
          <div className="bg-white p-4 rounded shadow">
            <h3 className="text-xl font-bold">Total Courses</h3>
            <p className="text-2xl">5</p>
          </div>
          <div className="bg-white p-4 rounded shadow">
            <h3 className="text-xl font-bold">Students Enrolled</h3>
            <p className="text-2xl">120</p>
          </div>
          <div className="bg-white p-4 rounded shadow">
            <h3 className="text-xl font-bold">Completion Rate</h3>
            <p className="text-2xl">85%</p>
          </div>
        </section>

        {/* Upcoming Sessions */}
        <section className="mt-6 bg-white p-6 rounded shadow">
          <h2 className="text-xl font-bold">Upcoming Sessions</h2>
          <ul className="mt-4">
            <li className="border-b py-2">UX Research - March 10, 2025</li>
            <li className="border-b py-2">Design Thinking - March 12, 2025</li>
            <li className="py-2">Prototyping - March 15, 2025</li>
          </ul>
        </section>

        {/* Course Progress */}
        <section className="mt-6">
          <h2 className="text-xl font-bold">Course Progress</h2>
          <div className="grid grid-cols-2 gap-4 mt-4">
            <div className="bg-white p-4 rounded shadow">
              <h3 className="font-bold">User Experience Design</h3>
              <div className="w-full bg-gray-300 rounded h-4 mt-2">
                <div className="bg-indigo-600 h-4 rounded" style={{ width: "70%" }}></div>
              </div>
              <p className="text-sm mt-2">70% Completed</p>
            </div>
            <div className="bg-white p-4 rounded shadow">
              <h3 className="font-bold">Web Accessibility</h3>
              <div className="w-full bg-gray-300 rounded h-4 mt-2">
                <div className="bg-indigo-600 h-4 rounded" style={{ width: "50%" }}></div>
              </div>
              <p className="text-sm mt-2">50% Completed</p>
            </div>
          </div>
        </section>
      </main>
    </div>
  );
};

export default InstructorHome;
